import React from 'react';

class Service extends React.Component {

  componentDidMount() {

  }
  numberRandom = () => {
    let numero_aleatorio = Math.random();
    numero_aleatorio = Math.floor(numero_aleatorio * 100);
    console.log(numero_aleatorio);
  }

  render() {
    return (
      <h1>Services</h1>
    )
  }
}

export default Service;
